import Item from 'antd/lib/list/Item';
import React from 'react'

export default function Comment(props) {

  console.log(props);

  return (
    <div className='comment-list'>
      {
        props.list.info.map(item=>{
          return (
            <div className='comment-item' key={item.id}>
              <p>电话：{item.tel}</p>
              <p>评价：{item.star}</p>
              <p>详情：{item.context}</p>
            </div>
          )
        })
      }
    </div>
  )
}
